01-mise-en-place/01-talk-service.html.body:
Service TalkService

Créer une classe TalkService dans le fichier src/services/talk.service.ts.

Ajouter une méthode findAllSessions retournant une Promesse de tableau de sessions.

Créer une class Session (src/domains/session.ts)



Ce service récupère les données depuis un appel HTTP sur le site du BreizhCamp.
Voici un exemple d'appel HTTP avec jquery :
import * as $ from "jquery";

const promise$ = $.get("https://jsonplaceholder.typicode.com/posts");

promise$.then(data =>
      console.log(data)
);


Modifier le fichier src/index.ts pour qu'il affiche dans la console les titres des sessions.

Les données sont récupérées à partir du service TalkService.

01-mise-en-place/04-router.html.body:
Routeur
Nous allons à cette étape établir une navigation par ancre :

http://localhost:8080#speakers-list affiche la liste des présentateurs;
http://localhost:8080#sessions-list affiche la liste des sessions;
...

Pour cela, nous allons écouter les événements load et onhashchange.
Mettre en place un routeur dans le fichier src/index.js à l'aide de l'exemple ci-dessous :
var router = () => {
    if (location.hash == '#speakers-list') {
        // TODO afficher vue liste des présentateurs
    } else if (location.hash == '#sessions-list') {
        // TODO afficher vue liste des sessions
    } else {
        // TODO afficher vue par défaut
    }
}

window.addEventListener('load', () => {

    window.onhashchange = () => {
        router();
    };

    router();
});


Créer une vue liste des sessions qui affiche les titres des sessions via la page http://localhost:8080#sessions-list.
